import "./App.css";
import getCharacters from "./fetchCharacters";
import { useState } from "react";

const App = () => {
  const [characters, setCharacters] = useState();
  useEffect(() => {
    const apiReturn = async () => {
      await getCharacters();
    };
    apiReturn();
  }, []);
  return (
    <div>
      {characters.map((char) => (
        <p>{char.name}</p>
      ))}
    </div>
  );
};

export default App;
